import React from 'react';
import { Link } from 'react-router-dom';
import { stationsAPI } from '/src/backend/axios';

const StationList = ({ match }) => {
  console.log(match.url)
  return (
    <div>
      <h3>Lista de estaciones</h3>
      <ul>
        <li>
          <Link to={`${match.url}/Station1`}>Station 1</Link>
        </li>
        <li>
          <Link to={`${match.url}/Station2`}>Station 2</Link>
        </li>
        <li>
          <Link to={`${match.url}/Station3`}>Station 3</Link>
        </li>
      </ul>
    </div>
  );
};

export default StationList;
